DROP TABLE IF EXISTS ods.station_name_corr;

CREATE TABLE ods.station_name_corr (
	station_name TEXT NULL,
	ref_name TEXT NOT NULL,
	is_foreign bool DEFAULT false NULL,
	CONSTRAINT station_name_corr_ref_name_station_name_key UNIQUE (ref_name, station_name)
);

DROP TABLE IF EXISTS ods.ref_departements;
CREATE TABLE ods.ref_departements (
    code_departement TEXT NOT NULL PRIMARY KEY,
    nom_departement TEXT NOT NULL,
    code_region TEXT NOT NULL,
    nom_region TEXT NOT NULL
);


